--
-- Name: sync_gr_from_po(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.sync_gr_from_po() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Auto-populate fields from purchase order
  IF NEW.po_id IS NOT NULL THEN
    SELECT
      po.po_number,
      po.vendor_id,
      v.company_name,
      COALESCE(d.workspace_id, u.workspace_id) as workspace_id
    INTO
      NEW.po_number,
      NEW.vendor_id,
      NEW.vendor_name,
      NEW.workspace_id
    FROM purchase_orders po
    LEFT JOIN vendors v ON v.id = po.vendor_id
    LEFT JOIN departments d ON d.id = po.department_id
    LEFT JOIN users u ON u.id = NEW.received_by_id
    WHERE po.id = po.id;
  END IF;

  RETURN NEW;
END;
$$;


--
-- Name: sync_ses_from_po(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.sync_ses_from_po() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Auto-populate fields from purchase order
  IF NEW.po_id IS NOT NULL THEN
    SELECT
      po.po_number,
      po.vendor_id,
      v.company_name,
      po.department_id,
      COALESCE(d.workspace_id, u.workspace_id) as workspace_id
    INTO
      NEW.po_number,
      NEW.vendor_id,
      NEW.vendor_name,
      NEW.department_id,
      NEW.workspace_id
    FROM purchase_orders po
    LEFT JOIN vendors v ON v.id = po.vendor_id
    LEFT JOIN departments d ON d.id = po.department_id
    LEFT JOIN users u ON u.id = NEW.accepted_by_id
    WHERE po.id = NEW.po_id;
  END IF;

  RETURN NEW;
END;
$$;


