);


--
-- Name: vendor_performance_scores; Type: TABLE; Schema: public; Owner: -
--

CREATE TABLE public.vendor_performance_scores (
    id uuid DEFAULT gen_random_uuid() NOT NULL,
    vendor_id uuid NOT NULL,
    year integer NOT NULL,
    month integer NOT NULL,
    delivery_score numeric(5,2),
    quality_score numeric(5,2),
    price_score numeric(5,2),
    responsiveness_score numeric(5,2),
    documentation_score numeric(5,2),
    overall_score numeric(5,2) NOT NULL,
    star_rating numeric(3,2) NOT NULL,
    evaluation_count integer DEFAULT 0 NOT NULL,
    transaction_count integer DEFAULT 0 NOT NULL,
    total_value numeric(15,2),
    category_id uuid,
    category_rank integer,
    category_percentile numeric(5,2),
    calculated_at timestamp without time zone DEFAULT now() NOT NULL,
    created_at timestamp without time zone DEFAULT now() NOT NULL,
    updated_at timestamp without time zone DEFAULT now() NOT NULL,
    CONSTRAINT vendor_performance_scores_month_check CHECK (((month >= 1) AND (month <= 12)))
);


